import React from "react";
import "./Home.css";
import ThisWeek from "../components/Homepage/ThisWeek";
import Hours from "../components/Homepage/Hours";

const Home: React.FC = () => {
  const completedDays = ["Sun", "Mon", "Tue", "Thu"];

  const hoursData = [
    { day: "Sun", hours: 5 },
    { day: "Mon", hours: 2 },
    { day: "Tue", hours: 3 },
    { day: "Wed", hours: 2 },
    { day: "Thu", hours: 5 },
    { day: "Fri", hours: 2 },
    { day: "Sat", hours: 2 },
  ];

  const totalHours = hoursData.reduce((sum, day) => sum + day.hours, 0);

  return (
    <div className="container">
            <header className="header">
                <h1>Welcome Jane</h1>
                <div className="header-icons">
                    <i className="icon-calendar"></i>
                    <i className="icon-bell"></i>
                </div>
            </header>

            <div className="section">
                <div className="section-title">This Week</div>
                <div className="section-subtitle">4/7 Days</div>
                <ThisWeek />
            </div>

            <div className="section">
                <div className="section-title">Hours</div>
                <div className="section-subtitle">20 hours</div>
                <Hours />
            </div>
        </div>
  );
};

export default Home;
